pragma solidity ^0.8.17;

import "hardhat/console.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

import "./BCTypes.sol";

interface ItemInterface {
    function testExternalCreateItem(address _player) external;
}

contract RoomTiles is Ownable {
    ItemInterface itemContract; // TODO: Temporary for testing

    BCTypes.RoomTile[] public roomTiles;

    constructor() {
        _initDefaultRooms();
    }

    // TODO: Why can't another contract get this via the autogen getter?
    function extGetRoomTile(uint256 _id) external view returns(BCTypes.RoomTile memory) {
        return roomTiles[_id];
    }

    // TODO: Put names in comments since they're not in data anymore
    function _initDefaultRooms() internal {
        // 0 Empty Space
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.NONE,
            0,

            0,
            0,

            // false,
            false
        ));
        // 1 Unexplored Room
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.NONE,
            0,

            0,
            0,

            // false,
            false
        ));
        // 2 Donghaijiu
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.NONE,
            9, // Ship services

            0,
            0,

            // false,
            false
        ));
        // 3 Armory
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.SCAVENGER,
            0,

            3,
            0,

            // true,
            // false,
            true
        ));
        // 4 Auxiliary Reactor
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.SHIP_SECURITY,
            0,

            0,
            1,

            // false,
            false
        ));
        // 5 Breached Reactor
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.SHIP_SECURITY,
            1,

            0,
            0,

            // true,
            true
        ));
        // 6 Bridge
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.SHIP_SECURITY,
            0,

            1,
            2,

            // false,
            true
        ));
        // 7 Bug nest
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.NONE, // TODO: This room is supposed to have a card event for
            2,

            0,
            0,

            // false,
            false
        ));
        // 8 Captain's Quarters
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.MYSTERY,
            0,

            1,
            2,

            // false,
            true
        ));
        // 9 Cargo Hold
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.SCAVENGER,
            0,

            1,
            0,

            // false,
            false
        ));
        // 10 Clone Room
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.MYSTERY,
            0,

            0,
            1,

            // false,
            false
        ));
        // 11 Computer Mainframe
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.BUG,
            0,

            0,
            3,

            // false,
            true
        ));
        // 12 Crossroads
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.SCAVENGER,
            3,

            0,
            0,

            // false,
            true
        ));
        // 13 Engineering Catwalk
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.NONE, // TODO: This room is supposed to have a card event for ship security!!!
            4,

            0,
            0,

            // false,
            false
        ));
        // 14 Escape Pods
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.MYSTERY,
            0,

            1,
            1,

            // false,
            false
        ));
        // 15 Galley
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.BUG,
            0,

            1,
            0,

            // false,
            false
        ));
        // 16 Hull Breach
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.MYSTERY,
            5,

            0,
            0,

            // true,
            true
        ));
        // 17 Lonely Corridor
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.NONE,
            0,

            1,
            0,

            // false,
            false
        ));
        // 18 Main Reactor
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.BUG,
            0,

            0,
            1,

            // false,
            true
        ));
        // 19 Medbay
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.SHIP_SECURITY,
            6,

            0,
            0,

            // false,
            false
        ));
        // 20 Observation Room
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.MYSTERY,
            0,

            0,
            1,

            // false,
            false
        ));
        // 21 Officer's Bunk
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.MYSTERY,
            0,

            1,
            0,

            // false,
            false
        ));
        // 22 Pantry
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.SCAVENGER,
            0,

            0,
            1,

            // false,
            false
        ));
        // 23 Pump Room
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.NONE,
            0,

            1,
            0,

            // false,
            false
        ));
        // 24 Reactor Control
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.SCAVENGER,
            0,

            0,
            1,

            // false,
            false
        ));
        // 25 Scavenger's Den
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.SCAVENGER,
            0,

            1,
            0,

            // false,
            false
        ));
        // 26 Scullery
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.BUG,
            0,

            1,
            0,

            // false,
            false
        ));
        // 27 Showers
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.BUG,
            7,

            0,
            0,

            // false,
            false
        ));
        // 28 Torpedo Tube
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.BUG,
            0,

            1,
            0,

            // false,
            false
        ));
        // NOTE: This is 27 tiles + Space Tile + Unexplored + Donghaijiu (and is zero-indexed)
        // 29 Trash Compactor
        roomTiles.push(BCTypes.RoomTile(
            BCTypes.BCEventType.SHIP_SECURITY,
            8,

            0,
            0,

            // false,
            true
        ));
    }

    function setItemContractAddress(address _address) public onlyOwner {
        itemContract = ItemInterface(_address);
    }

    function testExternalCallMint() public {
        itemContract.testExternalCreateItem(msg.sender);
    }

    function getNumRoomTiles() public view returns(uint256) {
        return roomTiles.length;
    }

    function returnAllRoomTiles() public view returns (BCTypes.RoomTile[] memory) {
        return roomTiles;
    }
}
